import { BrowserRouter, Route, Switch, /*Link*/ } from 'react-router-dom';

import './App.css';
import Register from './Register';
import Login from './Login';
import Activate  from './activate';
import BootstrapNavbar from './bootstrapNavbar';
import {
  Row,Col
} from 'reactstrap';

function App() {
  return (
  <div>
  <BrowserRouter>
  {/* <Link to="/register"><button>Rejestracja</button></Link><br />
  <Link to="/login"><button>Logowanie</button></Link><br />
  <Link to="/activate"><button>Aktywacja</button></Link><br /> */}
  <BootstrapNavbar />
  <Row>
  <Col sm="2" style={{border:"1px solid"}}><Login /></Col>
  <Col md="10" style={{border:"1px solid"}}>Main </Col>
  </Row>
  <Switch>
  <Route path="/register">
  <Register />
  </Route>
  <Route path="/login">
  <Login />
  </Route>
  <Route path="/activate">
  <Activate />
  </Route>
  </Switch>
  </BrowserRouter>
  </div>
  );
}

export default App;
